import "./Form.css";
import { useNavigate } from "react-router-dom";

function Form() {
  const navigate = useNavigate();
  return (
    <div className="form">
      <form>
        <label>
          Enter your name:
          <input type="text" />
        </label>
      </form>
      <button onClick={() => navigate("/")}>Home</button>
    </div>
  );
}

export default Form;
